import React from 'react';

import { FaTools,FaReact,FaCode } from 'react-icons/fa';
import { MdDevicesOther, } from 'react-icons/md';

import SkillComponents from './skillComponents'



const SkillList = () => {




    let listofskill=[

        {
            "icon":"FaCode",
            "title":"Main Languages",
            "desc":"HTML CSS and Javascript Front to back including ES6 syntax & REST api, npm, Typescript, with basic familiarity in jQuery, SASS and PHP.",
            "animation":"left"
        },
        {
            "icon":"FaReact",
            "title":"Frameworks",
            "desc":"Hands on libraries and frameworks like React.js, Redux, Angular, Bootstrap, and Node.js the Javascript Runtime Environment for the backend.",
            "animation":"right"
        },
        {
            "icon":"MdDevicesOther",
            "title":"Responsive Design",
            "desc":"For me website that is !responisve is !professional, Therefor I use native CSS or bootstrap to make my websites fully responsive for all devices.",
            "animation":"left"
        },
        {
            "icon":"FaTools",
            "title":"Tools & Apps",
            "desc":"Git and Github, Docker, MongoDB for managing DBs & Wordpress, Adobe Photoshop, XD, Figma + hands on web builders like Elementor.",
            "animation":"right"
        }



    ];


    const handleShowStripe = () => (
    listofskill.map((skill)=>(


       <SkillComponents

        icon={skill.icon}
        title={skill.title}
        desc={skill.desc}
        direction={skill.animation}
        >


        </SkillComponents





        >

    )));

    return(
        <div className="highlight_wrapper">
            <div className="skill">    {handleShowStripe()} </div>

        </div>
    )
}

export default SkillList;
